response.about:
ТЫ  ИЗ  ПРИМОРЬЯ,  если....

- говоришь, что "Хороший Руль Левым Не Назовут"; 
- знаешь, что "ШАМОРА" - это не только альбом Мумий Тролля; 
- автоматически допеваешь строчку "И ТОЛЬКО МООООООРЕЕЕ.... "; 
- хоть раз ездил в Уссурийск на ночной рынок; 
- пел на площади "УТЕКАЙ" за полгода до всей страны; 
- при словосочетании "КОРЕЙСКИЙ МАЙОНЕЗ" блаженно улыбаешься; 
- слово "СОПКИ" не ставит тебя в тупик; 
- ты знаешь, что самая лучшая погода - осенью; 
- ты знаешь, что такое МИЛКИС; 
- вид на море из окна не кажется тебе чем-то экзотическим; 
- словосочетание "поддержка отечественного автопрома" вызывает у тебя только смех; 
- определяешь наступление лета по перестающим закрываться дверям и отказывающемуся высыхать белью; 
- уверен, что маяк и фуникулёр - это такие остановки автобуса; 
- ветер 12 м/с для тебя и не ветер вовсе; 
- по привычке ищешь глазами море, куда бы ни взглянул; 
- пресные водоёмы вызывают у тебя непонятную брезгливость; 
- хождение по прямым улицам ставит тебя в тупик; 
- когда при 80% влажности местные задыхаются, ты расправляешь жабры; 
- ты знаешь, что "Новая волна" - это не молодежный конкурс в Юрмале; 
- знаешь, как выглядит корейская прессованная морская капуста; 
- ты хоть раз ездил на Фуникулере; 
- ты знаешь, что красная икра может быть в трехлитровых банках; 
- имя Винни Пух не вызывает у тебя желания напеть: "пум-пурум-пурум-пурум-пурум-пум-пум"; 
- при упоминании имен: Земфира, Илья Лагутенко и Братья Грим в тебе шевелится отеческая(материнская) гордость, как будто ты имеешь непосредственное отношение к творчеству этих людей; 
- при словах "радио Лемма" твое лицо искажает непроизвольная гримасса; 
- аббревиатура BSB не ассоциируется у тебя с чем-то попсовым; 
- фраза «Встречаемся на заре» не сообщает тебе о времени встречи; 
- ищешь чаек в стаях пернатых на площадях; 
- слыша "...Владивосток..." по ящику спрашиваешь "И что мы натворили на этот раз?"; 
- то что нет ветра - это странно; 
- Когда ты 5 минут бегаешь вокруг русского автобуса марки "Газель", пока наконец не поймешь, что у него дверь открывается иначе, чем у "Делики"; 
- Удивляешься, что бывают трамваи с сидушками со встроенным подогревом задницы. Трамваи должны вонять и дребезжать; 
- хотя бы раз сам готовил папоротник-орляк; 
- ожидаешь, что на ЖД вокзале будет пахнуть морем; 
- при слове ЧЕРЕП первая ассоциация - улыбка и очки; 
- что называть районы города именами древнегреческих героев типа Улисс, Диомид или Патрокл это нормально; 
- при слове Горностай думаешь о чём угодно, только не о пушном зверьке; 
- ездить каждую неделю на острова - не фантастика; 
- Япония для тебя не страна на краю света, а близкие соседи, родня практически; 
- ресторан с русской кухней это экзотика; 
- все остальные регионы нашей матушки Руси это конечно хорошо, но мы-то знаем, что всё это НЕМНОГО НЕ ТО; 
- возвращаясь и ПОДЪЕЗЖАЯ НА ПОЕЗДЕ К ВЛАДИВОСТОКУ ТЕБЯ ВСЕГДА ОХВАТЫВАЕТ ЭЙФОРИЯ И ПРЕДЧУВСТВИЕ ЧУДА; 
- слово "Набка" не вызывает у тебя недоумения; 
- прося купить конфеты "птичее молоко" ты знаешь о чём говоришь; 
- столица поднебесной ближе чем столица в которую положено рваться; 
- в Питере ноги устают от горизонтальности местности; 
- Большой Камень это не мистические ворота в параллельный мир; 
- ты спокойно относишься к тому, что пожарные машины в городе, это просто смешно; 
- автомобильная пробка движется в небо и это привычно; 
- ты знаешь кофе "Максим"; 
- слово "зеленка" не вызывает у тебя медицинских ассоциаций; 
- фраза "встретимся под пальцем" не вызывает недоумения; 
- когда тебя просят описать вкус трепанга, впадаешь в ступор; 
- химка - это не прическа; 
- ханка - это озеро;
